import MyFunnelChart from "./MyFunnelChart";
import React from "react";
const data = [
    { label: 'Step 1', value: 100 },
    { label: 'Step 2', value: 80 },
    { label: 'Step 3', value: 60 },
    { label: 'Step 4', value: 40 },
    { label: 'Step 5', value: 20 },
  ];
  const options = {
    width: 600,
    height: 400,
    bottomWidth: 1 / 3,
    bottomPinch: 1 / 3,
    isCurved: true,
    curveHeight: 20,
    fillType: 'solid',
    isInverted: false,
  };
  

const ParentComponent: React.FC = () => {
  return (
    <div>
      <MyFunnelChart data={data && options}/>
    </div>
  );
};

export default ParentComponent;
